  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Willow Creek,
  and Pishkun National Wildlife Refuge outlines Refuge accomplishments from July 1940
  to June 1941. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, and mammals-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. The public relations section of the report describes
  recreational uses, Refuge visitors, hunting, fishing, and violations. Items of interest
  and photographs are attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
